import logo from './logo.svg';
import './App.css';
import Login from './screens/login'
import React from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';


class App extends React.Component {
  render() {
    return (
      <div>
        <Router>
          <Switch>

          <Route path="/login">
              <Login></Login>
            </Route>
          </Switch>
        </Router>

      </div>
    )
  }
}

export default App;
